INSERT INTO `action` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`, `trailerurl`, `movieurl`) VALUES
(1, 'The Shawshank Redemption', 1994, 'Frank Darabont', 9.3, 'Morgan Freeman as Ellis Boyd \'Red\' Redding\r\nTim Robbins as Andy Dufresne\r\nClancy Brown as Captain Hadley\r\nRita Hayworth as Gilda Mundson Farrell', 'Chronicles the experiences of a formerly successful banker as a prisoner in the gloomy jailhouse of Shawshank after being found guilty of a crime he did not commit. The film portrays the man\'s unique way of dealing with his new, torturous life; along the way he befriends a number of fellow prisoners, most notably a wise long-term inmate named Red.', 'Action', , 'https://www.youtube.com/watch?v=NmzuHjWmXOc', 'https://www6.putlockertv.to/watch/the-shawshank-redemption.1nom/kwkjz64'),
(2, 'The Godfather', 1972, 'Francis Ford Coppola', 9.2, 'Marlon Brando as Don Vito Corleone\r\nAl Pacino as Michael Corleone\r\nTalia Shire as Connie\r\nDiane Keaton as Kay Adams', 'The Godfather \"Don\" Vito Corleone is the head of the Corleone mafia family in New York. He is at the event of his daughter\'s wedding. Michael, Vito\'s youngest son and a decorated WW II Marine is also present at the wedding. Michael seems to be uninterested in being a part of the family business. Vito is a powerful man, and is kind to all those who give him respect but is ruthless against those who do not. But when a powerful and treacherous rival wants to sell drugs and needs the Don\'s influence for the same, Vito refuses to do it. What follows is a clash between Vito\'s fading old values and the new ways which may cause Michael to do the thing he was most reluctant in doing and wage a mob war against all the other mafia families which could tear the Corleone family apart.', 'Action', , 'https://www.youtube.com/watch?v=sY1S34973zA', 'https://www6.putlockertv.to/watch/the-godfather.q9o3/ll3k116');
INSERT INTO `action` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`, `trailerurl`, `movieurl`) VALUES
(3, 'The Mountain II', 2016, 'Alper Caglar', 9.2, '', 'DAG II; tells the story of a clandestine special forces squad; call sign \'Storm Bringer\'. Following the events of the first film, Bekir and Oguz, unlikely best friends, have enrolled in the world famous, perpetually grueling Turkish special forces training. Their first mission begins six years later-- to infiltrate the most barbarous area of modern day Iraq for a rescue mission.', 'Action', , 'https://www.youtube.com/watch?v=z-9mbn-9ZQc', 'https://www.youtube.com/watch?v=f_Gc0RQUkXg');
INSERT INTO `action` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`, `trailerurl`, `movieurl`) VALUES
(4, 'The Dark Knight', 2008, 'Christopher Nolan', 9, 'Christian Bale as Bruce Wayne\r\nCillian Murphy as Scarecrow\r\nHeath Ledger as Joker\r\nWilliam Fichtner as Bank Manager', 'Set within a year after the events of Batman Begins (2005), Batman, Lieutenant James Gordon, and new District Attorney Harvey Dent successfully begin to round up the criminals that plague Gotham City, until a mysterious and sadistic criminal mastermind known only as \"The Joker\" appears in Gotham, creating a new wave of chaos. Batman\'s struggle against The Joker becomes deeply personal, forcing him to \"confront everything he believes\" and improve his technology to stop him. A love triangle develops between Bruce Wayne, Dent, and Rachel Dawes.', 'Action', , 'https://www.youtube.com/watch?v=Bp1Hv_-hLUY', 'https://www6.putlockertv.to/watch/the-dark-knight.n348/n33j5wm'),
(5, 'The Godfather: Part II', 1974, 'Francis Ford Coppola', 9, 'Robert De Niro as Vito Corleone\r\nAl Pacino as Michael\r\nTalia Shire as Connie Corleone\r\nDiane Keaton as Kay', 'The continuing saga of the Corleone crime family tells the story of a young Vito Corleone growing up in Sicily and in 1910s New York; and follows Michael Corleone in the 1950s as he attempts to expand the family business into Las Vegas, Hollywood and Cuba.', 'Action', , 'https://www.youtube.com/watch?v=9O1Iy9od7-A', 'https://www6.putlockertv.to/watch/the-godfather-2.r8pq/zlkkx9w'),
(6, 'Pulp Fiction', 1994, 'Quentin Tarantino', 8.9, 'Quentin Tarantino as Jimmie Dimmick\r\nBruce Willis as Butch Coolidge\r\nSamuel L. Jackson as Jules Winnfield\r\nJohn Travolta as Vincent Vega\r\n', 'Jules Winnfield (Samuel L. Jackson) and Vincent Vega (John Travolta) are two hit men who are out to retrieve a suitcase stolen from their employer, mob boss Marsellus Wallace (Ving Rhames). Wallace has also asked Vincent to take his wife Mia (Uma Thurman) out a few days later when Wallace himself will be out of town. Butch Coolidge (Bruce Willis) is an aging boxer who is paid by Wallace to lose his fight. The lives of these seemingly unrelated people are woven together comprising of a series of funny, bizarre and uncalled-for incidents.', 'Action', , 'https://www.youtube.com/watch?v=s7EdQ4FqbhY', 'https://www6.putlockertv.to/watch/pulp-fiction.m2zz/n3pn00n');
INSERT INTO `action` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`, `trailerurl`, `movieurl`) VALUES
(7, 'Schindler\'s List', 1993, 'Steven Spielberg', 8.9, 'Ralph Fiennes as Amon Goeth\r\nLiam Neeson as Oskar Schindler\r\nEmbeth Davidtz as Helen Hirsch\r\nBen Kingsley as Itzhak Stern', 'Oskar Schindler is a vainglorious and greedy German businessman who becomes an unlikely humanitarian amid the barbaric German Nazi reign when he feels compelled to turn his factory into a refuge for Jews. Based on the true story of Oskar Schindler who managed to save about 1100 Jews from being gassed at the Auschwitz concentration camp, it is a testament to the good in all of us.', 'Action', , 'https://www.youtube.com/watch?v=gG22XNhtnoY', 'https://www6.putlockertv.to/watch/schindlers-list.3rx2/zlk82zp'),
(8, 'The Lord of the Rings: The Return of the King', 2003, 'Peter Jackson', 8.9, 'Marton Csokas as Celeborn\r\nCate Blanchett as Galadriel\r\nMiranda Otto as Eowyn\r\nSean Bean as Boromir', 'The final confrontation between the forces of good and evil fighting for control of the future of Middle-earth. Frodo and Sam reach Mordor in their quest to destroy the One Ring, while Aragorn leads the forces of good against Sauron\'s evil army at the stone city of Minas Tirith.', 'Action', , 'https://www.youtube.com/watch?v=r5X-hFf6Bwo', 'https://www6.putlockertv.to/watch/the-lord-of-the-rings-the-return-of-the-king-extended-version.9oz0/qxk06jn'),
(9, '12 angry men', 1957, 'Sidney Lumet', 8.9, 'Henry Fonda as Juror #8\r\nJack Warden as Juror #7\r\nJack Klugman as Juror #5\r\nE.G. Marshall as Juror #4', 'The defense and the prosecution have rested and the jury is filing into the jury room to decide if a young man is guilty or innocent of murdering his father. What begins as an open-and-shut case of murder soon becomes a detective story that presents a succession of clues creating doubt, and a mini-drama of each of the jurors\' prejudices and preconceptions about the trial, the accused, and each other. Based on the play, all of the action takes place on the stage of the jury room.', 'Action', , 'https://www.youtube.com/watch?v=_13J_9B5jEk', 'https://www6.putlockertv.to/watch/12-angry-men.kw29/58voz0');
INSERT INTO `action` (`id`, `title`, `year`, `director`, `imdb`, `cast`, `synopsis`, `genre`, `image`, `trailerurl`, `movieurl`) VALUES
(10, 'Fight Club', 1999, 'David Fincher', 8.8, 'Brad Pitt as Tyler Durden\r\nJared Leto as Angel Face\r\nHelena Bonham Carter as Marla Singer\r\nEdward Norton as The Narrator', 'A nameless first person narrator (Edward Norton) attends support groups in attempt to subdue his emotional state and relieve his insomniac state. When he meets Marla (Helena Bonham Carter), another fake attendee of support groups, his life seems to become a little more bearable. However when he associates himself with Tyler (Brad Pitt) he is dragged into an underground fight club and soap making scheme. Together the two men spiral out of control and engage in competitive rivalry for love and power. When the narrator is exposed to the hidden agenda of Tyler\'s fight club, he must accept the awful truth that Tyler may not be who he says he is.', 'Action', , 'https://www.youtube.com/watch?v=qtRKdVHc-cE', 'https://www6.putlockertv.to/watch/fight-club.9om0/02r1v53');

